{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/robertbartalis/bellabeat-case-study?scriptVersionId=92015628\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# About The Company\n\n   *Bellabeat, is high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market.*\n\n   ![image.png](attachment:53e3df4f-5a1d-48c9-8162-8031ad6863fa.png)\n   ","metadata":{"_uuid":"dacdc2de-3eda-45f8-9b54-5ec27de9f5d5","_cell_guid":"ae03f671-cbc0-4493-9185-d2bbc22f9b20","trusted":true},"attachments":{"53e3df4f-5a1d-48c9-8162-8031ad6863fa.png":{"image/png":""}}},{"cell_type":"markdown","source":"# 1. Business Task\n  \n   Bellabeat wants to find new opportunities to grow its business. Therefore, we will analyze smart device data to gain insight into how consumers are using their smart devices. The\ninsights might help guide the marketing strategy for the company. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company.","metadata":{"_uuid":"63eca625-187c-4ea4-888d-66ef51f308ef","_cell_guid":"e4ee6831-26b5-45ec-b4a1-928306ca647b","trusted":true}},{"cell_type":"markdown","source":"# 2. Prepare","metadata":{"_uuid":"1d345f04-0521-438d-bee8-a02b81838d1e","_cell_guid":"f9ccb1b4-996b-4ed8-add4-889a9bf28f42","trusted":true}},{"cell_type":"markdown","source":"### 2.1 The Dataset:\n\nThe data source used for our case study is FitBit Fitness Tracker Data. This dataset is stored in Kaggle and was made available through Mobius.\n\nDue to the small amount of users in the dataset (30), we could encounter a sampling bias. Another problem we would encounter is that the dataset is not current and also the time limitation of the survey is only 31 days.","metadata":{"_uuid":"bef44b47-6a07-4988-a244-1d014f47ffa1","_cell_guid":"3e5fee9e-1c18-4c7d-92db-b50b4b6b5e34","trusted":true}},{"cell_type":"markdown","source":"### 2.2  Installing packages and opening libraries \n\nThe following packages will be used for our analysis:","metadata":{"_uuid":"b876afbc-e2e1-4e3d-bac6-7fff14e3aee6","_cell_guid":"e29491b5-0e2d-41bd-85dd-38dd97fae18d","trusted":true}},{"cell_type":"code","source":"library(tidyverse)\nlibrary(lubridate)\nlibrary(janitor)\nlibrary(ggthemes)\nlibrary(openair)\nlibrary(repr)","metadata":{"_uuid":"091bc00f-026c-4f03-971e-4a3da38f7c97","_cell_guid":"3b8c58f1-caa5-4179-b946-17a66478dfac","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.024948Z","iopub.execute_input":"2022-02-14T11:12:13.027766Z","iopub.status.idle":"2022-02-14T11:12:13.051355Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 2.3 Importing Data\n\nOn our analysis we will focus on the following datasets:\n* daily_activity\n* daily_intensity\n* daily_steps\n* hour_calories\n* hour_steps \n* daily_sleep\n\nDue to the the small sample size we won't consider for this analysis Weight (8 Users) and heart rate (7 users)","metadata":{"_uuid":"3d0206d4-df40-464b-a67e-bdf1685c724d","_cell_guid":"d8b42f79-9bc3-45df-a788-ceb6bb0b64fe","trusted":true}},{"cell_type":"code","source":"daily_activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\ndaily_intensity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv\")\ndaily_steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailySteps_merged.csv\")\ndaily_calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv\")\nhour_calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlyCalories_merged.csv\")\nhour_steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlySteps_merged.csv\")\ndaily_sleep <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")","metadata":{"_uuid":"d88919e5-8cb3-454a-b2c8-ff0e6cc4f42c","_cell_guid":"91e92267-8623-4cd3-9a33-e5ec8424cae8","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.054558Z","iopub.execute_input":"2022-02-14T11:12:13.055986Z","iopub.status.idle":"2022-02-14T11:12:13.180665Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 2.3 Previewing datasets\n\nWe will take a closer look at the data by using *head*, *str* and *glimpse*. I usually prefer *glimpse*","metadata":{"_uuid":"a8477b97-ad93-4524-bae6-5a61855eff27","_cell_guid":"2bcd93c0-f79a-46b5-a6a1-6a902d00995d","trusted":true}},{"cell_type":"code","source":"glimpse(daily_activity)\nglimpse(daily_intensity)\nglimpse(daily_sleep)\nglimpse(daily_steps)\nglimpse(hour_calories)\nglimpse(hour_steps)","metadata":{"_uuid":"5497d1a5-fd97-4435-b4ce-0cc7939da031","_cell_guid":"fc0421e8-60b2-428f-8dbf-0ae634d35356","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.183292Z","iopub.execute_input":"2022-02-14T11:12:13.184714Z","iopub.status.idle":"2022-02-14T11:12:13.241537Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# 3. Process","metadata":{"_uuid":"a07515e1-e250-4299-82b0-819270e25bb3","_cell_guid":"a05ec17d-8763-4142-8c47-ff698a0f293c","trusted":true}},{"cell_type":"markdown","source":"### 3.1 Removing some datasets\n\nAfter observing the different datasets, it can be concluded that the table **daily_activity**, already contains the information from **daily_calories** and **daily_intensity**. We can verify this with logicals.","metadata":{"_uuid":"9f7c2a3a-b64c-4de0-abe7-dee4b6fb3902","_cell_guid":"e22a0230-8fd7-432c-af25-20a32f0bd8a9","trusted":true}},{"cell_type":"code","source":"all(daily_activity$calories == daily_calories$calories)\nall(daily_activity$sedentary_minutes == daily_intensity$sedentary_minutes)\n\nrm(daily_calories, daily_intensity)","metadata":{"_uuid":"dd259d3e-d244-4da0-ba56-80be96c43ad7","_cell_guid":"1f83cf5c-a189-4dd6-b6e4-ec776b8225a0","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.243972Z","iopub.execute_input":"2022-02-14T11:12:13.245368Z","iopub.status.idle":"2022-02-14T11:12:13.276444Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 3.2 Cleaning and merging the data","metadata":{"_uuid":"daeb2979-9974-4713-a912-145f48cc7f66","_cell_guid":"afc8c02b-d08d-4394-aab3-4c10a414bfb1","trusted":true}},{"cell_type":"markdown","source":"**3.2.1** By using *clean_names* we ensure that column names are using the right syntax and same format in all datasets since we will merge them later on. We also change the date from *character* to *date* format.","metadata":{"_uuid":"1b2f0bc5-3abc-4517-99ed-bb8c0d69b08c","_cell_guid":"506cdbcd-ea94-439c-a296-cec5160dce7b","trusted":true}},{"cell_type":"code","source":"daily_activity <- daily_activity %>% \n  clean_names() %>% \n  mutate(date = mdy(activity_date)) %>% \n  select(-\"activity_date\")\n\ndaily_steps <- daily_steps %>% \n  clean_names() %>% \n  mutate(date = mdy(activity_day)) %>% \n  select(-\"activity_day\")","metadata":{"_uuid":"7cb9f9ec-3aff-416c-87f6-47607aa57f39","_cell_guid":"f6219fc3-e559-4081-9119-bb2eef280a55","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.278827Z","iopub.execute_input":"2022-02-14T11:12:13.28018Z","iopub.status.idle":"2022-02-14T11:12:13.337396Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.2.2** daily_sleep has \"00:00:00\" added after the date in every row. We need to separate this from the date in order for the column to be in accordance with the other data frames.","metadata":{"_uuid":"9c265bd8-fa0d-4dcb-9a9c-fc8f9ee3f0b2","_cell_guid":"5cd0fe9d-ecf7-4daa-995e-8c9cce5a91e8","trusted":true}},{"cell_type":"code","source":"daily_sleep <- daily_sleep %>% \n  clean_names() %>% \n  separate(col = sleep_day, into = c(\"date\", \"time\"), sep = \" \") %>% \n  mutate(date = mdy(date)) %>% \n  select(-\"time\")","metadata":{"_uuid":"ba316c0b-8bf0-479a-ae85-ba82ece1df83","_cell_guid":"01c4df3a-4570-4c61-bf91-52cce8e4ab62","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.339929Z","iopub.execute_input":"2022-02-14T11:12:13.341423Z","iopub.status.idle":"2022-02-14T11:12:13.380271Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.2.3** Since the hourly data frames have the same date/time format we can merge them first and perform the cleaning after. Here the date and time is in a single column so we need to separate them. We will also create a new column called **weekdays** using the newly formatted date column.","metadata":{"_uuid":"d8a66227-7a3c-4249-b26e-e1a044cee591","_cell_guid":"888d494d-9b7e-4bbe-85a1-d9f823a1f435","trusted":true}},{"cell_type":"code","source":"hour_total <- \n  left_join(hour_steps, hour_calories, by =c (\"Id\", \"ActivityHour\")) %>% \n  clean_names() %>% \n  separate(col = activity_hour, into = c(\"date\", \"time\"), sep = \" \", extra = \"merge\") %>% \n  mutate(date = mdy(date)) %>% \n  mutate(weekday = weekdays(date))","metadata":{"_uuid":"239c333f-9e09-47eb-b6c8-213d8fd0c911","_cell_guid":"d648be7a-e7e8-4bb9-af5d-15824afa3513","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:13.382791Z","iopub.execute_input":"2022-02-14T11:12:13.384201Z","iopub.status.idle":"2022-02-14T11:12:14.011626Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.2.4**  We need to convert the time to POSIXct, in order to be able to perform hour by hour analysis on our data. While doing this, we will also change the format from AM/PM to a 24 hour format for easier analysis.","metadata":{"_uuid":"40b46cc1-3670-40e6-b2ae-0be7819047e3","_cell_guid":"3aa175cd-951e-4752-84de-590f1c8e7fb3","trusted":true}},{"cell_type":"code","source":"hour_total$time <- format(as.POSIXct(hour_total$time, tz = \"NULL\", format=\"%I:%M:%S %p\"),format=\"%H:%M:%S\")","metadata":{"_uuid":"597f9418-b640-4f00-813e-a8e9e5c94a4c","_cell_guid":"bf5f8797-3dc6-4e86-ba78-35546ec31c2e","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.014792Z","iopub.execute_input":"2022-02-14T11:12:14.016474Z","iopub.status.idle":"2022-02-14T11:12:14.062841Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.2.5** Finally, we merge the daily data frames. We also remove the **tracker_distance** column as it is the same as **total_distance**. And for the sake of simplicity we add **moderately_active_distance** to **light_active_distance** and **fairly_active_minutes** to **lightly_active_minutes** in order to create just **active_distance** and **active_minutes**.","metadata":{"_uuid":"1c9aa5e3-409c-472c-9700-3c771cc97361","_cell_guid":"9841b58a-f878-4b31-8f41-4e12e07cd9f4","trusted":true}},{"cell_type":"code","source":"daily_total <- daily_activity %>% \n  select(- tracker_distance) %>% \n  merge(daily_steps, by = c (\"id\", \"date\")) %>% \n  left_join(daily_sleep, by = c (\"id\", \"date\")) %>% \n  mutate(active_distance = moderately_active_distance + light_active_distance,\n         active_minutes = fairly_active_minutes + lightly_active_minutes) %>% \n  select(- moderately_active_distance, - light_active_distance,\n         - fairly_active_minutes, - lightly_active_minutes, - step_total)","metadata":{"_uuid":"31e1edbb-b953-4abb-8e6e-fb7b2ac3161e","_cell_guid":"07fdccb2-b695-4e5f-bebd-6760db7c066c","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.066848Z","iopub.execute_input":"2022-02-14T11:12:14.068509Z","iopub.status.idle":"2022-02-14T11:12:14.108048Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 3.3 Removing duplicates","metadata":{"_uuid":"4b6ad7fe-a54d-4bf4-a3da-81b2d9497312","_cell_guid":"c67b1a1b-52e0-41ca-9834-5bb010a637bf","trusted":true}},{"cell_type":"markdown","source":"**3.3.1** We check both tables for duplicates:","metadata":{"_uuid":"c99b6886-a1f2-4eb0-b32d-4aa96b1ad4da","_cell_guid":"0e0227b0-3e4e-4fe0-aa99-f2cef0f10488","trusted":true}},{"cell_type":"code","source":"sum(duplicated(daily_total))\nsum(duplicated(hour_total))","metadata":{"_uuid":"5188545c-c3cc-4582-99fa-86f2c374e736","_cell_guid":"8b55a048-e848-4be1-8f07-3ed4abc05216","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.11057Z","iopub.execute_input":"2022-02-14T11:12:14.111962Z","iopub.status.idle":"2022-02-14T11:12:14.340586Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.3.2** It looks like **daily_total** has a couple of duplicate values. These can be removed by keeping only the ditinct values.","metadata":{"_uuid":"073d8674-b1f9-4556-b1d6-a35b55abc4c0","_cell_guid":"04b95d2b-f0f3-4dac-abaf-b45ad712dc20","trusted":true}},{"cell_type":"code","source":"daily_total <- daily_total %>% \n  distinct()","metadata":{"_uuid":"1c9fb9f8-b7f8-4b5a-978d-1c0c788862ca","_cell_guid":"d7a10feb-cea2-4d6d-8ce6-8b2b8cecfe73","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.343348Z","iopub.execute_input":"2022-02-14T11:12:14.344823Z","iopub.status.idle":"2022-02-14T11:12:14.358424Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**3.3.3** When double checking, we can see there are no more duplicate values remaining.","metadata":{"_uuid":"37aab457-905c-468a-9355-e0408cc8dcb7","_cell_guid":"8b78c79f-f21f-4e4a-b8d2-e7faebd31de7","trusted":true}},{"cell_type":"code","source":"sum(duplicated(daily_total))","metadata":{"_uuid":"d6e96dc6-7df3-48ef-a432-cafaabad2d8c","_cell_guid":"e2c2f49f-1979-43b3-8b9b-8337b52c0ba2","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.360972Z","iopub.execute_input":"2022-02-14T11:12:14.362504Z","iopub.status.idle":"2022-02-14T11:12:14.402732Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 3.3 Summarizing data","metadata":{"_uuid":"a92e3e24-2d0c-422e-a0a0-a553b81e534c","_cell_guid":"9fd53eda-186e-4792-9271-29c91f47aa64","trusted":true}},{"cell_type":"markdown","source":"Performing a quick summary on our 2 newly created data frames lets us quickly scan for any patterns, outliers or errors.","metadata":{"_uuid":"eb289442-d845-41ba-95e8-e3a862510fea","_cell_guid":"b049101b-511c-40e6-a8ad-d79b27e06130","trusted":true}},{"cell_type":"code","source":"summary(daily_total)\nsummary(hour_total)","metadata":{"_uuid":"6eba6377-31c5-44b4-8240-647c0d7bc242","_cell_guid":"454986ba-c680-4253-925d-9413fc739866","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.405318Z","iopub.execute_input":"2022-02-14T11:12:14.406738Z","iopub.status.idle":"2022-02-14T11:12:14.441365Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# 4. Analyze & Share","metadata":{"_uuid":"05e0c213-1b09-4798-833f-083307b15fdf","_cell_guid":"07e79a8b-b5c0-436d-9b32-4762cf4c8cdc","trusted":true}},{"cell_type":"markdown","source":"In order to give this analysis a clear structure, we will analyze the data from 3 key perspectives: **Usage**, **Sleep** and **Activity**","metadata":{}},{"cell_type":"markdown","source":"## 4.1 Usage","metadata":{"_uuid":"7b73b632-8b26-4662-8f1c-e6171809bbff","_cell_guid":"16b870d3-8bda-4525-913c-0d56053d97f3","trusted":true}},{"cell_type":"markdown","source":"**4.1.1** We will start by creating a new data frame called **daily total usage** (**dtu**),which will help us analyze the usage of these devices. We can start by calculating the sum of all the minutes and see if they add up to the daily total of 1440 for each user. Unfortunately, **total_minutes_asleep** has a lot of NA values, these will be replaced with 0 in order for us to be able to perform calculations.","metadata":{"_uuid":"beb80821-6b1b-43be-bc42-2ce6fe33a925","_cell_guid":"702610a6-090e-4a2d-b32a-e16b9fb3de8d","trusted":true}},{"cell_type":"code","source":"dtu <- daily_total %>%\n  mutate(minutes_asleep = if_else(is.na(total_minutes_asleep), 0, as.double(total_minutes_asleep))) %>% \n  mutate(total_minutes = active_minutes + very_active_minutes + sedentary_minutes + minutes_asleep)","metadata":{"_uuid":"048b5f53-2fa9-4ede-b29d-26c9883acacd","_cell_guid":"23096bbf-ae1b-437f-810b-36b1735eaf58","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.444167Z","iopub.execute_input":"2022-02-14T11:12:14.445561Z","iopub.status.idle":"2022-02-14T11:12:14.462492Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.1.2** The below bar chart represents the average daily usage of each user.","metadata":{"_uuid":"a92a0673-6095-4054-ad4d-8e02862757b6","_cell_guid":"4d0d81cc-3bb5-4139-88b6-5a7735681c37","trusted":true}},{"cell_type":"code","source":"dtu %>% group_by(id) %>% \n  summarize(mean_total_minutes = mean(total_minutes)) %>% \n  mutate(id = factor(id)) %>% \n  ggplot(aes(mean_total_minutes, id)) + geom_col(fill = \"blue\") +\n  theme_bw() + geom_vline(xintercept = 1440, color=\"red\", size = 2) + labs(title = \"Average daily usage in minutes\")","metadata":{"_uuid":"5b6bd791-72e4-4594-89f9-d4c4b6c07af8","_cell_guid":"a33b6751-8eca-4fcc-a847-362c31e8c3c6","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:14.465015Z","iopub.execute_input":"2022-02-14T11:12:14.466387Z","iopub.status.idle":"2022-02-14T11:12:15.466923Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.1.3** We can see that all the users were very close to the total 1440 minutes, with 7 of them averaging 1440 every day they wore the watch. My first question was: \"How can this be when there are a lot of **0** values for **total_minutes_asleep**?\" I think it is because the devices used are bad at telling the difference between **minutes_asleep** and **sedentary_minutes**, but we will look into this later under the *Sleep* section.","metadata":{"_uuid":"ee91d923-7a1b-4a36-bbcc-df2e93669fb9","_cell_guid":"a9964c8c-fa4f-4f1e-982c-e8336c0a975a","trusted":true}},{"cell_type":"markdown","source":"**4.1.4** Now that we know the average usage in a day, let's check if everyone used it for the entire 31 day duration of this experiment.","metadata":{"_uuid":"d063631e-e05a-404f-8a64-46bd31a0166c","_cell_guid":"693e6ba0-e7d8-4a8e-9be9-c66f90427723","trusted":true}},{"cell_type":"code","source":"dtu %>% \n  mutate(id = factor(id)) %>% \n  ggplot(aes(y = id)) + geom_bar(fill = \"blue\") +\n  theme_bw() + geom_vline(xintercept = 31, color=\"red\", size = 2) + labs(x = \"Days\") + \n  labs(title = \"Total days of usage\")","metadata":{"_uuid":"f6c67ee3-07b3-428a-913d-3c24c0296b86","_cell_guid":"44800616-fd42-4c79-9bf5-6fa4e600cc89","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:15.469436Z","iopub.execute_input":"2022-02-14T11:12:15.470844Z","iopub.status.idle":"2022-02-14T11:12:16.529589Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.1.5** While the majority (21) used the device for the entire period, 10 of the users opted out before finishing the experiment. 1 user even quit after 4 days.","metadata":{"_uuid":"5b816e3b-17e1-407c-8ee0-8e58ba9693d0","_cell_guid":"4db2b75e-344d-4d41-abdf-357d55b81106","trusted":true}},{"cell_type":"markdown","source":"**4.1.6** I want to see if the users who didn't complete the full 31 days, chose not to wear the device randomly or they just get tired of wearing it and each on of them started giving up towards the end. This information might be useful, as if the latter is true, the design of the device might be the reason why the users couldn't go through with the experiment and chose to take it off. The below calendar plot was originally created to monitor the air pollution throughout the calendar days, but it's also perfectly useable in our situation.","metadata":{"_uuid":"e927d9aa-754e-4ecc-a7e1-da223e73a1ca","_cell_guid":"daa76122-c46c-4065-b8bb-8ecf2c60e439","trusted":true}},{"cell_type":"code","source":"dtu %>% \n  mutate(id = factor(id)) %>% group_by(date) %>% \n  summarize(user_permonth = n()) %>% \n  calendarPlot(dtu, pollutant = \"user_permonth\", year = 2016, month = 4:5)","metadata":{"_uuid":"f17ce916-3691-4a2a-a993-329de6dc2feb","_cell_guid":"5ee16eae-4334-4b14-b96e-b36bfde5028a","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:16.532144Z","iopub.execute_input":"2022-02-14T11:12:16.533666Z","iopub.status.idle":"2022-02-14T11:12:17.471541Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.1.7** The plot clearly shows that everyone was using the devices in the beginning and as the days passed, they slowly started taking it off. Only 22 users still had the device on the last day of the experiment.","metadata":{"_uuid":"902e8088-0f77-492b-99f6-2bdb1a5c9907","_cell_guid":"dba574f1-1094-4be8-88a7-06cd8e6f6228","trusted":true}},{"cell_type":"markdown","source":"## 4.2 Sleep","metadata":{"_uuid":"aca54ad9-33d4-4fbd-82c5-80728b242ea4","_cell_guid":"55feb751-c636-4457-9170-1017d0339b6a","trusted":true}},{"cell_type":"markdown","source":"**4.2.1** Let's start with looking at the situation mentioned at *4.1.3*, where I believe the device confuses sleep with **sedentary_minutes**. If we arrange our data frame by **minutes_asleep** and then **sedentary_minutes**, a quick scroll through will let us know if the correlation between these two columns.","metadata":{"_uuid":"ca365ac0-0dac-42c5-b71d-7cbcec2fe957","_cell_guid":"7eb383ba-667a-46f8-82d6-30846025f14f","trusted":true}},{"cell_type":"code","source":"head(dtu %>% arrange(minutes_asleep, sedentary_minutes))","metadata":{"_uuid":"edbd47ab-9bcf-4bce-b863-ab9b071c1b8e","_cell_guid":"d056a63b-dc36-4f08-b977-278ffcfe0a91","execution":{"iopub.status.busy":"2022-02-14T11:12:17.473956Z","iopub.execute_input":"2022-02-14T11:12:17.475356Z","iopub.status.idle":"2022-02-14T11:12:17.506981Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.2** At first glance it looks like where **minutes_asleep** is **0**, the **sedentary minutes** are unusually high. To be sure, below we can calculate how much higher are the **sedentary_minutes** in case there isn't any sleep.","metadata":{"_uuid":"95ba307b-e51b-43fc-8388-ae3e467c2a21","_cell_guid":"5bb0f5be-3f06-430f-aef7-96a1620ba31c","trusted":true}},{"cell_type":"code","source":"sleep <- filter(dtu, minutes_asleep != 0) \nnosleep <- filter(dtu, minutes_asleep == 0) \n(mean(sleep$sedentary_minutes)/mean(nosleep$sedentary_minutes))*100","metadata":{"_uuid":"27d14d01-f5f4-4f49-bf9a-892f65142837","_cell_guid":"b2429cb4-0266-4d3b-aed1-4154a0db9a03","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:17.509391Z","iopub.execute_input":"2022-02-14T11:12:17.510752Z","iopub.status.idle":"2022-02-14T11:12:17.533997Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.3** It looks like in cases where there was no sleep, the **sedentary_minutes** were 59% higher than in the cases where there was sleep. But what about the cases where there is sleep? Is that also inversely correlated with the **sedentary_minutes**? The below scatter plot should give us the answer","metadata":{"_uuid":"c9461aab-29da-4265-8fab-12ca3ba38541","_cell_guid":"9b1b8039-beca-48ad-86ad-652b54aca75f","trusted":true}},{"cell_type":"code","source":"dtu %>% filter(minutes_asleep != 0) %>% \n  ggplot(aes(minutes_asleep, sedentary_minutes)) + geom_point() + theme_bw() + geom_smooth() + \n  annotate(\"text\", label = paste(\"R:\", round(cor(dtu$minutes_asleep, dtu$sedentary_minutes, use = \"complete.obs\"), 2)),\n           x = 135, y = 210, size = 6, colour = \"black\") + labs(title = \"Sleep vs Sedentary Minutes\")","metadata":{"_uuid":"320c1bb1-92e2-4c99-8207-261d72b63c4d","_cell_guid":"ab39770a-428c-4600-9f4a-8690fd14051e","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:17.536578Z","iopub.execute_input":"2022-02-14T11:12:17.538008Z","iopub.status.idle":"2022-02-14T11:12:18.550444Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.4** The scatter plot and the -0.84 correlation coefficient shows that there is a clear inverse correlation between sleep and sedentary minutes. All of these facts point towards the users suffering from severe sleep insomnia or the device not being able to clearly tell when the person is asleep or when he is awake.","metadata":{"_uuid":"9d111709-9758-4aa9-8f9e-7dccb5e0a9d5","_cell_guid":"45a181e1-f7c8-4587-abd3-78cdb1f1a106","trusted":true}},{"cell_type":"markdown","source":"**4.2.5** Let's further dive into the this by converting the slept minutes into hours and checking out the histogram of sleep.","metadata":{}},{"cell_type":"code","source":"ggplot(daily_total, aes(total_minutes_asleep / 60, fill = ..count..)) + geom_histogram(bins = 40, position = \"dodge\" ) +\n  theme_bw() + scale_x_continuous(breaks = 1:14) + labs(title = \"Sleep distribution\", x = \"Hours\")","metadata":{"_uuid":"e6be636b-a800-4592-851e-7a5ecf095810","_cell_guid":"3526d17d-9de0-4abd-87f9-c582bcfb89dd","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:18.552918Z","iopub.execute_input":"2022-02-14T11:12:18.55437Z","iopub.status.idle":"2022-02-14T11:12:19.594177Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.6** Looks like the majority of the distribution is around the typical 7 hour mark, but there also seem to be some extreme values especially towards the lower side of the chart. I believe these outliers are because of the inability of the device to recognize sleep sometimes. For the sake of data accuracy, we will remove outliers under 3 hours and 30 minutes and above 10 hours and 30 minutes when further studying sleep.","metadata":{}},{"cell_type":"code","source":"daily_total_sleep <- filter(daily_total, total_minutes_asleep > 210 & total_minutes_asleep < 630)","metadata":{"execution":{"iopub.status.busy":"2022-02-14T11:12:19.596666Z","iopub.execute_input":"2022-02-14T11:12:19.598065Z","iopub.status.idle":"2022-02-14T11:12:19.612309Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.7** Now that we have a more accurate data frame for sleep, I am interested how it corelates to the other metrics like **active_minutes**, **calories**, **very_active_minutes** and **total_steps**.","metadata":{}},{"cell_type":"code","source":"ggplot(daily_total_sleep, aes(total_minutes_asleep, active_minutes)) + geom_point() + \n  annotate(\"text\", label = paste(\"R:\", round(cor(daily_total_sleep$total_minutes_asleep, daily_total_sleep$active_minutes, use = \"complete.obs\"), 2)),\n  x = 250, y = 450, size = 6, colour = \"black\") + theme_bw() + geom_smooth(se = FALSE) + labs(title = \"Sleep vs Active Minutes\")\n\nggplot(daily_total_sleep, aes(total_minutes_asleep, calories)) + geom_point() + \n  annotate(\"text\", label = paste(\"R:\", round(cor(daily_total_sleep$total_minutes_asleep, daily_total_sleep$calories, use = \"complete.obs\"), 2)),\n  x = 250, y = 4500, size = 6, colour = \"black\") + theme_bw() + geom_smooth(se = FALSE) + labs(title = \"Sleep vs Calories\")\n\ndaily_total_sleep %>% filter(very_active_minutes != 0) %>% \nggplot(aes(total_minutes_asleep, very_active_minutes)) + geom_point() + \n  annotate(\"text\", label = paste(\"R:\", round(cor(daily_total_sleep$total_minutes_asleep, daily_total_sleep$very_active_minutes, use = \"complete.obs\"), 2)),\n           x = 250, y = 200, size = 6, colour = \"black\") + theme_bw() + geom_smooth(se = FALSE) + ylim(0, 225) + labs(title = \"Sleep vs Very Active Minutes\")\n\nggplot(daily_total_sleep, aes(total_minutes_asleep, total_steps)) + geom_point() + \n  annotate(\"text\", label = paste(\"R:\", round(cor(daily_total_sleep$total_minutes_asleep, daily_total_sleep$total_steps, use = \"complete.obs\"), 2)),\n           x = 250, y = 20000, size = 6, colour = \"black\") + theme_bw() + geom_smooth(se = FALSE) + labs(title = \"Sleep vs Steps\")","metadata":{"_uuid":"3c531a97-f37c-4b66-8daf-790a8f412dc3","_cell_guid":"5e398a1d-4c1d-43d0-8a78-a628ca1c5b0f","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:19.614804Z","iopub.execute_input":"2022-02-14T11:12:19.616244Z","iopub.status.idle":"2022-02-14T11:12:23.899856Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.8** There seems to be no correlation in any of the above scatter plots. There is a slight inverse correlation (-0.23) between sleep and steps but I think the data is to limited and the correlation is to insignificant in order to arrive at any conclusions.","metadata":{}},{"cell_type":"markdown","source":"**4.2.10** To get a better understanding of the users sleeping habits, we will group them into 3 categories:\n* Healthy Sleep: More then 7 hours and 30 minutes\n* Insufficient Sleep: Between 7 hours 30 minutes and 5 hours 30 minutes\n* Unhealthy Sleep: Under 5 hours 30 minutes\n\nThe categories are based on the book *Why we sleep? by Matthew Walker*","metadata":{}},{"cell_type":"code","source":"sleep_groups <- daily_total_sleep %>% group_by(id) %>% \n  summarize(average_sleep = mean(total_minutes_asleep, na.rm = TRUE)) %>%\n  drop_na(average_sleep) %>% \n  mutate(sleep_type = case_when(\n    average_sleep >= 450 ~ \"healthy_sleep\",\n    average_sleep < 450 & average_sleep > 330 ~ \"insufficient_sleep\",\n    average_sleep < 330 ~ \"unhealthy_sleep\",\n  ))","metadata":{"_uuid":"e0c38609-d876-481a-83f9-02a9a4b11255","_cell_guid":"39a01cd0-e1eb-4bc4-b20f-3520a603c263","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:23.902318Z","iopub.execute_input":"2022-02-14T11:12:23.903698Z","iopub.status.idle":"2022-02-14T11:12:23.926608Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.11** Now that each user has their sleep categorized under **sleep_type**, we can calculate the total percentage of each type of sleep and visualize it in a pie chart.","metadata":{}},{"cell_type":"code","source":"sleep_percent <- sleep_groups %>% \n  group_by(sleep_type) %>% \n  summarize(count = n()) %>% \n  mutate(total = sum(count)) %>% \n  mutate(total_percent = count/total) %>% \n  mutate(percentage = scales::percent(total_percent)) %>% \n  select(- total, - total_percent)","metadata":{"_uuid":"bd88a9eb-24dd-4d19-9325-2c6d0e4aa365","_cell_guid":"bf95e56a-ab6a-4432-bb0b-1a8ea0fa66b7","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:23.929201Z","iopub.execute_input":"2022-02-14T11:12:23.930623Z","iopub.status.idle":"2022-02-14T11:12:23.96085Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"sleep_percent %>%\n  ggplot(aes(x=\"\",y = percentage, fill= sleep_type)) +\n  geom_bar(stat = \"identity\", width = 1) + coord_polar(\"y\", start=0) +\n  theme_minimal() +  geom_text(aes(label = percentage), position = position_stack(vjust = 0.5), family = \"bold\") +\n  theme(axis.ticks = element_blank(),\n        axis.title.x = element_blank(),\n        axis.title.y = element_blank(),\n        axis.text.x = element_blank(),\n        panel.border = element_blank(),\n        plot.title = element_text(hjust = 0.5),\n        panel.grid = element_blank()) + labs(title = \"Sleep type distribution\")","metadata":{"_uuid":"f32b34e2-4764-4532-beea-4bd74070ec09","_cell_guid":"3ded7231-0240-4737-bb50-1acfd5c48274","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:23.96334Z","iopub.execute_input":"2022-02-14T11:12:23.964725Z","iopub.status.idle":"2022-02-14T11:12:24.85254Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.2.11** Only 20% of the users get a healthy amount of sleep. The 75% majority fall into the *insuffucient sleep* category, while 5% are sleeping an unhealthy amount. This is quite typical for the modern society, where less than a quarter of the people still get the recommended 8 hours. This information might prove useful in our case. The Bellabeat product could warn people of the dangers of insufficient sleep if the required amount is not met.","metadata":{}},{"cell_type":"markdown","source":"## 4.3 Activity","metadata":{"_uuid":"13d379d0-ed2a-44f5-9c56-9120dd93bd58","_cell_guid":"3b7cce68-b0be-4e79-b683-16c16dbf4327","trusted":true}},{"cell_type":"markdown","source":"**4.3.1** The below chart shows that our users are fairly active. Average total steps per day (represented by the red line) are 7638 which is a little bit less than the 8,000 steps per day recommended by the CDC, which was associated with a 51% lower risk for all-cause mortality (or death from all causes). Taking 12,000 steps per day was associated with a 65% lower risk compared with taking 4,000 steps.","metadata":{}},{"cell_type":"code","source":"dtu %>% group_by(id) %>% \n  summarize(mean_total_steps = mean(total_steps)) %>% \n  mutate(id = factor(id)) %>% \n  ggplot(aes(mean_total_steps, id)) + geom_col(fill = \"blue\") +\n  theme_bw() + geom_vline(xintercept = 7638, color=\"red\", size = 2) + labs(title = \"Average daily steps by user\")","metadata":{"execution":{"iopub.status.busy":"2022-02-14T11:12:24.854831Z","iopub.execute_input":"2022-02-14T11:12:24.856169Z","iopub.status.idle":"2022-02-14T11:12:25.846809Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.3.2** We all know that more activity leads to more calories burned and it looks like our data backs it up. The strong correlation shown in the scatter plot proves that walking is still one of the best and most convinient form of exercise for weight loss.","metadata":{}},{"cell_type":"code","source":"ggplot(hour_total, aes(step_total, calories, color = calories)) + geom_jitter() +\n  annotate(\"text\", label = paste(\"R:\", round(cor(hour_total$step_total, hour_total$calories, use = \"complete.obs\"), 2)),\n           x = 500, y = 800, size = 6, colour = \"black\") + theme_bw() + geom_smooth(se = FALSE) + labs(title = \"Steps vs Calories\")","metadata":{"_uuid":"f99cbe2e-1b00-47b1-b3fc-ab7512ff461f","_cell_guid":"cfff85ca-91e8-4840-8a15-018716414742","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:25.84937Z","iopub.execute_input":"2022-02-14T11:12:25.850815Z","iopub.status.idle":"2022-02-14T11:12:28.520127Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.3.3** Next we will check when exactly are the users the most active during the days of the week. First we will need to convert our **weekday** column into a factor, this way we will have they days in the right order.","metadata":{}},{"cell_type":"code","source":"options(repr.plot.width=30, repr.plot.height = 30)\n\nhour_total <- hour_total %>% mutate(weekday = fct_relevel(weekday ,c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\",\"Sunday\")))\n\nhour_total %>% group_by(time, weekday) %>% \n  summarize(average_steps = mean(step_total)) %>% \n  ggplot(aes(time, average_steps, fill = average_steps)) + geom_col() + scale_fill_gradient(low = \"green\", high = \"red\") +\n  theme(axis.text.x = element_text(angle = 90)) + facet_wrap(~ weekday) + theme(text = element_text(size = 25)) + labs(title = \"Average nr. of steps every hour during the week\")\n\n","metadata":{"_uuid":"bb667af6-a4b1-4b0e-94bb-0366a983ea4b","_cell_guid":"5dda0229-8761-43df-aeab-3021f9bb3cc0","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-02-14T11:12:28.524638Z","iopub.execute_input":"2022-02-14T11:12:28.527252Z","iopub.status.idle":"2022-02-14T11:12:30.006296Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"**4.3.4** Looks like on the weekdays the users prefer exercising right after work, from 17:00 to 19:00. On the weekends it is different. Saturday around noon has the biggest spike a during all the week, while on Sunday the users seem to be less active than any other day. The device could use this data to recommend exercise just at the right time for each user.\n","metadata":{}},{"cell_type":"markdown","source":"# 5. Conclusion and Recommendations","metadata":{}},{"cell_type":"markdown","source":"In order for us to respond to our business task and help Bellabeat on their mission, based on our results, I would advice to use own tracking data for further analysis. Datasets used have a small sample and can be biased since we didn't have any demographic details of users. Knowing that our main target are young and adult women, it would have been advantageous to know the gender of our users. Having an inisght into how men and women use the product differently, could help us find behaviors specific to women and target these behaviors through marketing strategies. I would encourage to continue finding trends to be able to create a marketing stragety focused on women\n\nThat being said, after our analysis we have found different trends that may the campaign and improve Bellabeat app:\n\n1. The users didn't wear the device the entire 24 hours of the day and 32% stopped using it before the 31 days expired. This leads me to believe that the devices need to become more wearable. Some key features that would help in this case are:\n    * Water-resistant\n    * Long-lasting batteries\n    * Fashion/ elegant products\n2. The devices used in this dataset had a hard time differentiating sleep from being sedentary. It could give Bellabeat an edge on its competitors if this process could be perfected. Considering that 80% of the users don't get enough sleep,the app could also educate users on the importance of getting 8 hours of sleep and send notifications when it's the appropriate time to go to bed.\n3. The data shows that walking is still one of the best methods to lose weight. Based on users objectives, Bellabeat could recommend a minimum number of steps for users to take,to encorage them to achieve their goals. In order to create a habit of exercising every day, Bellabeat could send a notification at a specific time for the user to remain consistent throughout the week.\n","metadata":{}}]}